import styled from "styled-components"

const Container = styled.div`
min-width: 360px;
height: 400px;
background-color: antiquewhite;
margin: 5px;
display: flex;
justify-content: center;
align-items: center;
position: relative;
`
const Circle = styled.div`
width: 200px;
height: 200px;
border-radius: 50%;
background-color: white;
position: absolute;
`
const Img = styled.img`
height: 75%;
z-index: 3;
`

export const Product = ({ item }) => {
    return (
        <Container>
            <Circle>
                <Img src={item.img} />

            </Circle>
        </Container>
    )
}
